template <typename T, InlineBitmap::EnableIfSame<T>*> bool InlineBitmap::Equals(const T& other_struct) const
{
    if (!mojo::Equals(this->image_info, other_struct.image_info))
        return false;
    if (!mojo::Equals(this->pixel_data, other_struct.pixel_data))
        return false;
    return true;
}

template <typename T, InlineBitmap::EnableIfSame<T>*> bool operator<(const T& lhs, const T& rhs)
{
    if (lhs.image_info < rhs.image_info)
        return true;
    if (rhs.image_info < lhs.image_info)
        return false;
    if (lhs.pixel_data < rhs.pixel_data)
        return true;
    if (rhs.pixel_data < lhs.pixel_data)
        return false;
    return false;
}

